import React from "react";

const SobreNosotros = () => {
    return (
        <main style={styles.main}>
            <img
             src="/images/portada.jpg" 
             alt="funny-mind"
             style={styles.image} 
             />
            <h1 style={styles.title}>Sobre Nosotros</h1>
            
        </main>
    );
};

const styles = {
    main: {
        padding: '2rem',
        fontFamily: 'Arial, sans-serif',
        maxWidth: '900px',
        margin: '0 auto',
        textAlign: 'center',
      },
      title: {
        fontSize: '2.5rem',
        color: '#F5F5F5',
        marginBottom: '1.5rem',
      }
}

export default SobreNosotros;
